import React, { useState } from 'react';
import { useBookings } from '../context/BookingContext';
import { useAuth } from '../context/AuthContext';
import { format, addDays, startOfWeek, isSameDay, parseISO, getHours, getMinutes, isToday } from 'date-fns';
import './ScheduleView.css';

const HOURS = Array.from({ length: 11 }, (_, i) => i + 9); // 9 to 19
const DAYS = 7; // Monday to Sunday
const START_HOUR = 9;
const END_HOUR = 19;
const SLOT_HEIGHT = 90; // px per hour

const WeekScheduleView: React.FC = () => {
  const { bookings, removeBooking, editBooking } = useBookings();
  const { isAuthenticated } = useAuth();
  const [selectedDate, setSelectedDate] = useState(new Date().toISOString().split('T')[0]);
  const selected = new Date(selectedDate);
  const weekStart = startOfWeek(selected, { weekStartsOn: 1 }); // Monday
  const weekDates = Array.from({ length: DAYS }, (_, i) => addDays(weekStart, i));
  const [editingBooking, setEditingBooking] = useState<any>(null);
  const [editForm, setEditForm] = useState<any>(null);

  // Helper to get bookings for a specific date
  const getBookingsForDay = (date: Date) => {
    return bookings.filter(booking => {
      const bookingDate = booking.date.length > 10 ? booking.date.split('T')[0] : booking.date;
      return isSameDay(parseISO(bookingDate), date);
    });
  };

  const getBookingTypeColor = (type: string) => {
    switch (type) {
      case 'meeting':
        return '#888888'; // grey
      case 'teaching_session':
        return '#27ae60'; // green
      case 'stand_up':
        return '#2980ef'; // blue
      default:
        return '#888888';
    }
  };

  const getEventStyle = (booking: any) => {
    const [startHour, startMin] = booking.startTime.split(':').map(Number);
    const [endHour, endMin] = booking.endTime.split(':').map(Number);
    const totalMinutes = (END_HOUR - START_HOUR) * 60;
    const startMinutes = (startHour - START_HOUR) * 60 + startMin;
    const endMinutes = (endHour - START_HOUR) * 60 + endMin;
    const top = (startMinutes / totalMinutes) * (SLOT_HEIGHT * (END_HOUR - START_HOUR));
    const height = ((endMinutes - startMinutes) / 60) * SLOT_HEIGHT;
    return {
      position: 'absolute' as 'absolute',
      left: 8,
      right: 8,
      top: top,
      height: height,
      zIndex: 2,
      borderRadius: 8,
      boxShadow: '0 2px 8px rgba(0,0,0,0.12)',
      background: getBookingTypeColor(booking.type),
      color: '#fff',
      display: 'flex',
      flexDirection: 'column' as 'column',
      alignItems: 'center',
      justifyContent: 'center',
      textAlign: 'center' as 'center',
      padding: '6px 10px',
      fontSize: '1.05rem',
    };
  };

  const handleEditClick = (booking: any) => {
    setEditingBooking(booking);
    setEditForm({ ...booking });
  };

  const handleEditChange = (e: React.ChangeEvent<HTMLInputElement | HTMLSelectElement | HTMLTextAreaElement>) => {
    const { name, value } = e.target;
    setEditForm((prev: any) => ({ ...prev, [name]: value }));
  };

  const handleEditSave = () => {
    if (editingBooking) {
      editBooking(editingBooking.id, editForm);
      setEditingBooking(null);
    }
  };

  const handleEditCancel = () => {
    setEditingBooking(null);
  };

  return (
    <div className="week-schedule-container google-calendar-style">
      <div className="week-schedule-table-row">
        <div className="week-schedule-table-wrapper">
          <div className="google-calendar-grid">
            <div className="google-calendar-times">
              {Array.from({ length: END_HOUR - START_HOUR }, (_, i) => (
                <div key={i} className="google-calendar-time-label" style={{ height: SLOT_HEIGHT }}>{format(new Date().setHours(START_HOUR + i, 0, 0, 0), 'h a')}</div>
              ))}
            </div>
            <div className="google-calendar-days">
              {weekDates.map(date => (
                <div
                  key={date.toISOString()}
                  className={`google-calendar-day-col${isToday(date) ? ' google-calendar-today' : ''}`}
                  style={{ height: SLOT_HEIGHT * (END_HOUR - START_HOUR), position: 'relative' }}
                >
                  <div className="google-calendar-day-header">
                    <div>{format(date, 'EEE')}</div>
                    <div>{format(date, 'dd/MM')}</div>
                  </div>
                  {/* Events */}
                  {getBookingsForDay(date).map(booking => (
                    <div key={booking.id} style={getEventStyle(booking)}>
                      <div style={{ fontWeight: 600 }}>{booking.title}</div>
                      <div style={{ fontSize: '0.95em' }}>{booking.presenter}</div>
                      <div style={{ fontSize: '0.92em' }}>{booking.startTime} - {booking.endTime}</div>
                      <div style={{ fontSize: '0.85em', fontWeight: 500 }}>{booking.type.replace('_', ' ').toUpperCase()}</div>
                      {isAuthenticated && (
                        <div style={{ display: 'flex', gap: 4, marginTop: 4 }}>
                          <button className="booking-edit-btn" onClick={() => handleEditClick(booking)} title="Edit">‚úèÔ∏è</button>
                          <button className="booking-delete-btn" onClick={() => removeBooking(booking.id)} title="Delete">üóëÔ∏è</button>
                        </div>
                      )}
                    </div>
                  ))}
                  {/* Hour lines */}
                  {Array.from({ length: END_HOUR - START_HOUR + 1 }, (_, i) => (
                    <div
                      key={i}
                      className="google-calendar-hour-line"
                      style={{ top: i * SLOT_HEIGHT }}
                    />
                  ))}
                </div>
              ))}
            </div>
          </div>
        </div>
        <div className="week-schedule-date-picker-col">
          <label htmlFor="week-date-picker">Select Week: </label>
          <input
            id="week-date-picker"
            type="date"
            value={selectedDate}
            onChange={e => setSelectedDate(e.target.value)}
          />
        </div>
      </div>
      {editingBooking && (
        <div className="modal-overlay">
          <div className="modal-content">
            <h3>Edit Booking</h3>
            <input name="title" value={editForm.title} onChange={handleEditChange} placeholder="Title" />
            <input name="booker" value={editForm.booker} onChange={handleEditChange} placeholder="Booker" />
            <input name="presenter" value={editForm.presenter} onChange={handleEditChange} placeholder="Presenter" />
            <input name="startTime" value={editForm.startTime} onChange={handleEditChange} type="time" />
            <input name="endTime" value={editForm.endTime} onChange={handleEditChange} type="time" />
            <select name="type" value={editForm.type} onChange={handleEditChange}>
              <option value="meeting">Meeting</option>
              <option value="teaching_session">Teaching Session</option>
              <option value="stand_up">Stand-up</option>
            </select>
            <input name="numberOfPeople" value={editForm.numberOfPeople} onChange={handleEditChange} type="number" min="1" max="50" />
            <textarea name="description" value={editForm.description} onChange={handleEditChange} placeholder="Description" />
            <div style={{ display: 'flex', gap: 8, marginTop: 12 }}>
              <button onClick={handleEditSave}>Save</button>
              <button onClick={handleEditCancel}>Cancel</button>
            </div>
          </div>
        </div>
      )}
    </div>
  );
};

export default WeekScheduleView;
